description:
Twila Slesnick, John Suttle, &quot;Nolo's Essential Retirement Tax Guide: Your Health, Home, Investments &amp; More&quot;
 NOLO | 2008-12-08 | ISBN: 1413309127 | 350 pages | PDF | 3.4 MB

 Retire and keep your hard-earned cash! When you retire, your potential tax deductions change considerably - and if you're a baby boomer on your way to retirement, you'll want to keep your hands on as much of your money as possible. That's why you need Nolo's Essential Retirement Tax Guide, the first book of its kind that helps boomers and their parents understand their tax benefits in plain English.
